import styled from "styled-components";

export const Transaction = styled.div`
  position: absolute;
  border-radius: 5px 5px 0px 0px;
  background: #555;
  color: #fff;
  width: 50%;
  // height: 60%;
  right: 2em;
  top: 2em;
  .contain ul {
    list-style: none;
  }
  .contain li {
    padding: 10px 0px;
    margin: 1.5em 0em;
    text-align: center;
    cursor: pointer;
  }
`;
